import React from "react";
import styled from "styled-components";
import withImages from "next-images";

import NavbarComp from "../UI/NavbarComp";

import HeroCar from "../../public/images/landing/hero-car.png";

const Landing = () => {
  return (
    <Container>
      <NavbarComp />
      <div className="hero-background">
        <div>
          {/* <img src={HeroCar} alt="Car" /> */}
          <h3>Sam's Auto</h3>
        </div>
      </div>
      <style jsx>
        {`
          .hero-background {
            width: 100%;
            height: 100%;
            position: absolute;
            background: url("HeroCar");
          }
        `}
      </style>
    </Container>
  );
};

export default Landing;

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #151515;
  font-family: "Quicksand", sans-serif;
  color: white;
`;
const HeroDiv = styled.div`
  width: 100vw;
  background: url("../../public/images/landing/hero-car.png");
  background-position: center center;
`;
